import React, {useState} from 'react'

import { Link } from 'react-router-dom';
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';
import Info from "./Info";
import Gallery from "./Gallery";
import Portofolio from "./Portofolio";
import FAQ from "./FAQ";


import './Icon.css'

function Icon(){
  
return(
    <Route>
        <Switch>
        <Route path="/info" exact component={Info}></Route>
        <Route path="/gallery" exact component={Gallery}></Route>
        <Route path="/port" exact component={Portofolio}></Route>
        <Route path="/fqa" exact component={FAQ}></Route>
       
        </Switch>
        
    <div class="container">
        <Link to="" className="btn btn-1">
     
                <h2>icon</h2>
     
        </Link>

    <Link to="gallery" className="btn btn-2">
       
            {/* <i className="fa fa-chevron-up"></i> */}
            <h2>abt</h2>
     
    </Link>

    <Link to="port"  className="btn btn-3">
        
    {/* <i className="fa fa-music"></i> */}
        <h2>blg</h2>
    
    </Link>

    <Link to="faq" className="btn btn-4" >
       
        {/* <i className="fa fa-globe"></i> */}
        <h2>cnt</h2>
     
    </Link>

    <Link  to="info" className="btn btn-5">
        
            <h2>info</h2>
     
    </Link>
</div>
</Route>
)
}

export default Icon
